ersion":"Versão Axe","viewTreemapLabel":"Ver mapa em árvore","showRelevantAudits":"Mostrar auditorias relevantes para:"}},"stackPacks":[{"id":"wordpress","title":"WordPress","iconDataURL":"data:image/svg+xml,\u003csvg xmlns=\"http://www.w3.org/2000/svg\" viewBox=\"0 0 122.5 122.5\">\u003cg fill=\"%232f3439\">\u003cpath d=\"M8.7 61.3c0 20.8 12.1 38.7 29.6 47.3l-25-68.7c-3 6.5-4.6 13.7-4.6 21.4zm88-2.7c0-6.5-2.3-11-4.3-14.5-2.7-4.3-5.2-8-5.2-12.3 0-4.8 3.7-9.3 8.9-9.3h.7a52.4 52.4 0 0 0-79.4 9.9h3.3c5.5 0 14-.6 14-.6 2.9-.2 3.2 4 .4 4.3 0 0-2.9.4-6 .5l19.1 57L59.7 59l-8.2-22.5c-2.8-.1-5.5-.5-5.5-.5-2.8-.1-2.5-4.5.3-4.3 0 0 8.7.7 13.9.7 5.5 0 14-.7 14-.7 2.8-.2 3.2 4 .3 4.3 0 0-2.8.4-6 .5l19 56.5 5.2-17.5c2.3-7.3 4-12.5 4-17z\"/>\u003cpath d=\"m62.2 65.9-15.8 45.8a52.6 52.6 0 0 0 32.3-.9l-.4-.7zM107.4 36a49.6 49.6 0 0 1-3.6 24.2l-16.1 46.5A52.5 52.5 0 0 0 107.4 36z\"/>\u003cpath d=\"M61.3 0a61.3 61.3 0 1 0 .1 122.7A61.3 61.3 0 0 0 61.3 0zm0 119.7a58.5 58.5 0 1 1 .1-117 58.5 58.5 0 0 1-.1 117z\"/>\u003c/g>\u003c/svg>","descriptions":{"uses-long-cache-ttl":"Leia sobre [Colocação do navegador em cache no WordPress](https://wordpress.org/support/article/optimization/#browser-caching).","unused-css-rules":"Considere reduzir ou mudar o número de [plugins do WordPress](https://wordpress.org/plugins/) que carregam CSS não utilizadas na sua página. Para identificar plugins que estejam a adicionar CSS não reconhecido, experimente realizar a [cobertura de código](https://developer.chrome.com/docs/devtools/coverage/) nas DevTools do Chrome. Pode identificar o tema/plugin responsável a partir do URL da folha de estilos. Esteja atento a plugins que tenham muitas folhas de estilo na lista com muito vermelho na cobertura do código. Um plugin só deve ter uma folha de estilos na lista de espera se esta for realmente utilizada na página.","unminified-javascript":"Um número de [plug-ins do WordPress](https://wordpress.org/plugins/search/minify+javascript/) pode acelerar o seu site ao concatenar, reduzir e comprimir os seus scripts. Poderá ainda utilizar um processo de criação para proceder previamente à redução se possível.","unused-javascript":"Considere reduzir ou mudar o número de [plugins do WordPress](https://wordpress.org/plugins/) que carregam JavaScript não utilizado na sua página. Para identificar plugins que estejam a adicionar JS não reconhecido, experimente realizar a [cobertura de código](https://developer.chrome.com/docs/devtools/coverage/) nas DevTools do Chrome. Pode identificar o tema/plugin responsável a partir do URL do script. Esteja atento a plugins que tenham muitos scripts na lista com muito vermelho na cobertura do código. Um plugin só deve ter um script na lista de espera se este for realmente utilizado na página.","render-blocking-resources":"Há vários plug-ins do WordPress que o podem ajudar a [colocar recursos críticos inline](https://wordpress.org/plugins/search/critical+css/) ou [adiar recursos menos importantes](https://wordpress.org/plugins/search/defer+css+javascript/). Tenha em atenção que as otimizações oferecidas por estes plug-ins podem quebrar funcionalidades do seu tema ou plug-ins, pelo que poderá ser necessário efetuar alterações ao código.","efficient-animated-content":"Considere carregar o GIF para um serviço que o disponibilizará para incorporação como vídeo HTML5.","modern-image-formats":"Considere usar o plugin [Performance Lab](https://wordpress.org/plugins/performance-lab/) para converter automaticamente as suas imagens JPEG carregadas em WebP, sempre que possível.","uses-text-compression":"Pode ativar a compressão de texto na configuração do servidor Web.","uses-responsive-images":"Carregue imagens diretamente a partir da [biblioteca de multimédia](https://wordpress.org/support/article/media-library-screen/) para garantir que estão disponíveis os tamanhos de imagem necessários e, em seguida, introduza-as a partir da biblioteca de multimédia ou utilize o widget de imagens para garantir que são utilizados os tamanhos ideais das imagens (incluindo as referentes a breakpoints adaptáveis). Evite utilizar imagens de `Full Size`, a menos que as dimensões sejam adequadas à utilização. [Saiba mais](https://wordpress.org/support/article/inserting-images-into-posts-and-pages/).","uses-optimized-images":"Considere utilizar um [plugin do WordPress de otimização da imagem](https://wordpress.org/plugins/search/optimize+images/) que comprima as imagens, ao mesmo tempo que mantém a qualidade.","offscreen-images":"Instale um [plugin do WordPress de carregamento lento](https://wordpress.org/plugins/search/lazy+load/) com capacidade para adiar imagens não visíveis ou para mudar para um tema com essa funcionalidade. Considere ainda a utilização do [plugin de AMP](https://wordpress.org/plugins/amp/).","total-byte-weight":"Considere mostrar excertos nas suas listas de publicações (por exemplo, através da etiqueta de mais), reduzir o número de publicações apresentadas numa determinada página, dividir as publicações longas em várias páginas ou utilizar um plugin para tornar o carregamento de comentários lento.","server-response-time":"Escolha um tema leve (idealmente um tema de bloco) e implemente a colocação em cache de páginas completas ou uma solução de site estático. Desative os plug-ins desnecessários para minimizar a sobrecarga do servidor. Considere atualizar o seu alojamento para um serviço dedicado ou gerido.","unminified-css":"Um número de [plug-ins do WordPress](https://wordpress.org/plugins/search/minify+css/) pode acelerar o seu site ao concatenar, reduzir e comprimir os seus estilos. Poderá ainda utilizar um processo de criação para proceder previamente à redução se possível."}}],"entities":[{"name":"nakamuramudancas.com.br","isFirstParty":true,"isUnrecognized":true,"origins":["https://nakamuramudancas.com.br"]}],"fullPageScreenshot":{"screenshot":{"height":12196,"data":"data:image/webp;base64,UklGRhLyBQBXRUJQVlA4WAoAAAAgAAAARQUAsi8ASUNDUMgBAAAAAAHIAAAAAAQwAABtbnRyUkdCIFhZ
